INSERT INTO `project`.`exam_result` (`id`,`q_no`,`examiner`,`question`,`exam_name`,`ans`) VALUES (575, 1, 'Rosarda, Sean Harvey Cabebe', 'A technician has been tasked with loading the operating system on every PC with a blank hard drive on a network. The technician wishes to install the operating system with minimal physical interaction with the PCs. Which of the following is the BEST way to accomplish this?\r\n', 'CompTIA A+ Certification Exam', 'IV'),(576, 2, 'Rosarda, Sean Harvey Cabebe', 'A user calls the help desk because a folder containing critical business files is missing from the local drive. The user is adamant that the folder was there the previous day, and cannot understand why it is gone. The technician views the properties of the parent folder and sees a back up listed on the Prior Versions tab. According to the theory of troubleshooting, which of the following is the technicians NEXT step?\r\n', 'CompTIA A+ Certification Exam', 'Establish a theory of probable cause\r\n'),(577, 3, 'Rosarda, Sean Harvey Cabebe', 'Which of the following operating systems can be upgraded directly to Windows 7\r\nProfessional by a default installation? (Select TWO).', 'CompTIA A+ Certification Exam', 'Windows Vista Business\r\n'),(578, 4, 'Rosarda, Sean Harvey Cabebe', 'A technician has upgraded four computers and would like to securely repurpose the hard drives for later use. Which of the following should the technician do to the drives to prepare them for later use?', 'CompTIA A+ Certification Exam', 'Drive wipe\r\n'),(579, 5, 'Rosarda, Sean Harvey Cabebe', 'When using Microsoft Windows 8.1 Operating System, which of the following features allows scripts and snippets to run?', 'CompTIA A+ Certification Exam', 'Power Shell\r\n'),(580, 6, 'Rosarda, Sean Harvey Cabebe', 'A user updates the video driver on the computer and it requests a restart after installation.\r\nThe computer never gets past the loading Windows page without rebooting. Which of the following should the technician use to resolve this issue without losing any vital files or programs?', 'CompTIA A+ Certification Exam', 'System Recovery'),(581, 7, 'Rosarda, Sean Harvey Cabebe', 'A technician suspects that a computer issue is caused by a failed NIC. Following the troubleshooting theory, which of the following is the NEXT step the technician should take?', 'CompTIA A+ Certification Exam', 'Test the theory to determine cause'),(582, 8, 'Rosarda, Sean Harvey Cabebe', 'A customer is reporting a burning smell coming from a CRT monitor. Which of the following should be taken into consideration before attempting to resolve the customers issue?', 'CompTIA A+ Certification Exam', 'CRT monitors should be serviced by qualified personnel\r\n'),(583, 9, 'Rosarda, Sean Harvey Cabebe', 'A user has recently installed Windows 7 on a computer. They ran Windows updates, updated the firmware and installed a printer. The user accessed a P2P application and now they are getting a large amount of browser pop-ups. Which of the following is MOST likely the cause of the pop-ups?', 'CompTIA A+ Certification Exam', 'Malware\r\n'),(584, 10, 'Rosarda, Sean Harvey Cabebe', 'When the computer is turned on it emits a series of beeps and does not POST. This can be caused by a bad:', 'CompTIA A+ Certification Exam', 'video card'),(585, 11, 'Rosarda, Sean Harvey Cabebe', 'A technician is called into the office during a thunderstorm. Users are reporting that machines are intermittently powering off. Which of the following will BEST prevent user data loss?', 'CompTIA A+ Certification Exam', 'A UPS\r\n'),(586, 12, 'Rosarda, Sean Harvey Cabebe', 'When securing a mobile device, which of the following types of screen locks is the MOST secure?', 'CompTIA A+ Certification Exam', 'Fingerprint lock\r\n'),(587, 13, 'Rosarda, Sean Harvey Cabebe', 'A technician has been tasked with loading the operating system on every PC with a blank hard drive on a network. The technician wishes to install the operating system with minimal physical interaction with the PCs. Which of the following is the BEST way to accomplish this?\r\n', 'CompTIA A+ Certification Exam', 'SHORT ANSWER'),(588, 14, 'Rosarda, Sean Harvey Cabebe', 'A user calls the help desk because a folder containing critical business files is missing from the local drive. The user is adamant that the folder was there the previous day, and cannot understand why it is gone. The technician views the properties of the parent folder and sees a back up listed on the Prior Versions tab. According to the theory of troubleshooting, which of the following is the technicians NEXT step?\r\n', 'CompTIA A+ Certification Exam', 'SHORT ANSWER'),(589, 15, 'Rosarda, Sean Harvey Cabebe', 'Which of the following operating systems can be upgraded directly to Windows 7\r\nProfessional by a default installation? (Select TWO).', 'CompTIA A+ Certification Exam', 'False'),(590, 16, 'Rosarda, Sean Harvey Cabebe', 'A technician has upgraded four computers and would like to securely repurpose the hard drives for later use. Which of the following should the technician do to the drives to prepare them for later use?', 'CompTIA A+ Certification Exam', 'True'),(591, 17, 'Rosarda, Sean Harvey Cabebe', 'When using Microsoft Windows 8.1 Operating System, which of the following features allows scripts and snippets to run?', 'CompTIA A+ Certification Exam', 'Assignment essay tasks are set to assist students to develop mastery of their study subject. Firstly, assignment tasks enhance understandings about subject matter. Yang and Baker (2005) reason that “to master your learning materials and extend your understandings, you need to write about the meanings you gain from your research” (p. 1). Secondly, research (Jinx, 2004; Zapper, 2006) clearly demonstrates that students learn the writing conventions of a subject area while they are researching, reading and writing in their discipline. This activity helps them to “crack the code” of the discipline (Bloggs, 2003, p. 44). Thus, students are learning subject matter and how to write in that disciplinary area by researching and writing assignment essays.'),(592, 18, 'Rosarda, Sean Harvey Cabebe', 'A user updates the video driver on the computer and it requests a restart after installation.\r\nThe computer never gets past the loading Windows page without rebooting. Which of the following should the technician use to resolve this issue without losing any vital files or programs?', 'CompTIA A+ Certification Exam', 'Discuss why assignment essays are common assessment tasks in undergraduate tertiary coursework, and evaluate the effectiveness of assignments as an avenue for learning. (Word limit 500 words – 10% leeway) Please note that the APA referencing style is used in this sample essay.'),(593, 19, 'Rosarda, Sean Harvey Cabebe', 'When using Microsoft Windows 8.1 Operating System, which of the following features allows scripts and snippets to run?', 'CompTIA A+ Certification Exam', 'IV'),(594, 20, 'Rosarda, Sean Harvey Cabebe', 'A user updates the video driver on the computer and it requests a restart after installation.\r\nThe computer never gets past the loading Windows page without rebooting. Which of the following should the technician use to resolve this issue without losing any vital files or programs?', 'CompTIA A+ Certification Exam', 'IV');
